    return (
       <Container>
        <h1>Profile</h1>
        </Container>

    )
}

UserProfile.getInitialProps = async (ctx) =>{
    const res = await fetch(`https://reqres.in/api/users/${ctx.query.id}`);
    const resJSON = await res.json();
    return {}
}

export default UserProfile
